      const savedUser = await this.userRepository.save(newUser);
      return this.buildUserRO(savedUser);
    }
  }


}

</code></pre>
<p>and also the <code>user.interface.ts</code>:</p>
<pre><code>export interface UserData {
  username: string;
  _id: string;
}

// user response object
