  user: UserData;
}
</code></pre>
<p>and a part of the <code>user.controller.ts</code>:</p>
<pre><code>  @Get(':id')
  findOne(@Param('id') id: string): Promise&lt;UserRO&gt; {
    console.log(`getting user with id: ${id}`);
    const user = this.serv.get(id);
    return user;
  }
</code></pre>
<p>and finally the <code>model/user.entity.ts</code>:</p>
<pre><code>@Entity({ name: 'User' })
export class User {
  @ObjectIdColumn()
  _id: string;

  @Column({ type: 'varchar', length: 50 })
  username: string;

  @OneToMany((type) =&gt; Context, (context) =&gt; context.user)
