How `transform` in mongoose schema works?<p>Picture of my user model :<a href="https://i.stack.imgur.com/fpRSe.png" rel="noreferrer"><img src="https://i.stack.imgur.com/fpRSe.png" alt="enter image description here" /></a>
In my user model I have this as second argument to my user model, to delete <code>__v</code> and replace <code>_id</code> by <code>id</code>:</p>
<pre><code>  {
    toJSON: {
      transform: function (doc, ret) {
        ret.id = ret._id;
        delete ret._id;
        delete ret.password;
        delete ret.__v;
      },
    },
  }
</code></pre>
<p>In my signin router I have something like this :</p>
<pre><code>const existingUser = await User.findOne({email});
console.log(&quot;existingUser*&quot;, existingUser)
